(80632, 180044, 0, 1, '炸彈客', '音樂就像是我們緊握在手中的炸藥，玩起來很危險也很冒險，在一剎那間，我們把各種不同的元素放在導線下面，引爆後的火花，也是如此的華麗的在心中畫下永遠不滅的句點。', '2014-09-27 00:00:00', 2000, 20, 0, 1, 'Bombers madding the party\n火藥味你們感覺到了嗎\n不要懷疑現在就是炸彈客 爆炸的火花 轟炸的音箱\n引爆　你們準備好了嗎\n引爆　你們想要躲到哪裡去\n引爆　現在開始到數五秒　5-4-321\n\nW E R THE B O M B E R S !! 　　　　\n\nYou know what ? 　　　　　　　　 （你知道嗎？）\nI know you afraid !　　　　　　　　（我知道你感到害怕了！）\nYou know that we gonna exploded！（因為你知道我們即將引爆！）\n\n點燃著引爆的導線　丟掉你身上的魁儡\n釋放你燃燒的狂野　衝破你眼前的視線\n', '', 171, '', '白文彥、李昌祐、伍基正', '李昌祐、伍基正', '', '炸彈客 The Bombers', '', 0, 1, 0, '2014-09-27 14:34:56', '2015-03-12 14:09:51', '0000-00-00 00:00:00'),
(80633, 307452, 7004, 7, '貓空山腳', '2014.9.27，退伍剩165天。\n\n我還記得第一首練的吉他曲，那是在聽得到蟲鳴鳥叫的山上宿舍練的，那年宿舍很吵，整棟到了深夜都是吉他的聲音。到現在吉他還是沒有長進多少，但我還是永遠不會忘記那幾年唱過的歌。還記得那時有個莫名其妙的校園活動，叫做「理院鬼屋」，後來也成為絕響了。就這樣想到一些有的沒有的，荒誕不經的，我們當時沒做之後也就不會再做的事。\n\n還好，至少我永遠不會忘記那幾年唱過的歌。', '2014-04-01 00:00:00', 2000, 8, 0, 7, '我懷念貓空山腳那些日子\n誰修了涼通識，廢了一輩子\n我懷念貓空山腳那些日子\n在河堤唱歌，說不完的故事\n\n我們突破門禁 潛入誰的領域\n再偷偷溜出 "蔣公"換腿的馬匹\n理院鬼屋 文化盃 任性的嬉戲\n一期一會 都鑲嵌在卡片裡\n\n每一次獨自上山 何其孤單\n夜間一元公車 也想有你作伴\n回到宿舍 整樓都是吉他的聲音\n練著yellow練著fix you 想成為搖滾巨星\n\n我懷念貓空山腳那些日子\n誰修了涼通識，廢了一輩子\n我懷念貓空山腳那些日子\n在河堤唱歌，說不完的故事\n\n後來我們陸續都要畢業了\n你還上街遊行嗎 還聽不聽張懸\n你說你現在朝九晚五，如此妥協\n我說我們是永遠的摩登少年\n我說我們是永遠的摩登少年', '', 227, '', '', '', '', '亂彈阿哲', '', 0, 1, 0, '2014-09-27 16:23:54', '2015-03-12 14:09:51', '0000-00-00 00:00:00'),
