(80654, 307136, 7287, 1, 'Shadows Under Water', '', '2014-09-21 00:00:00', 2000, 19, 0, 7, '', 'Shadows Under Water/ Yu-Shin, WEN.\n\n水面像靜止的\n絲綢緞般倒映著各種顏色\n光影交錯折射\n沒發現影子對著他唱歌\n\n突然覺得陌生\n熟悉卻不是屬於我的\n這是為何？\n像隔離現實的殼\n我腦袋放空\n甚至自己是誰都遺忘了\n\n現在\n彷彿一個人乘著\n獨木船\n心跳逐漸緩慢\n享受這孤單', 255, '', '', '', '', 'StreetVoice 街聲', 'TWS651434001', 1, 1, 0, '2014-09-29 17:34:54', '2015-03-12 14:09:52', '0000-00-00 00:00:00'),
(80655, 160421, 7286, 12, '最後的Merry Christmas', '', '2014-10-03 00:00:00', 2000, 19, 0, 1, '', '', 284, '', '', '', '', '滾石唱片 ROCK RECORDS', '', 0, 0, 0, '2014-09-29 17:35:36', '2015-03-12 14:09:52', '0000-00-00 00:00:00'),
