(80657, 307136, 7287, 2, '墜落：懸空', '', '2014-09-21 00:00:00', 2000, 19, 0, 7, '', '墜落: 懸空/ Yu-Shin, WEN.\n\n他只靜靜的看著我\n什麼都不說\n只是從容不迫\n\n一場突然的⾬雨後\n濛濛 不需語⾔言的溝通\n\n呼吸輕與重  \n代替聲⾳音抑揚頓挫\n在我⽿耳邊甚⾄至⼼心中\n肆無慢慢的滲透\n\n有種怯懦的節奏\n加上一點點的征服衝動 \nOh 這⽩白⽇日夢 \n陌⽣生的恐懼在瞬間無蹤\n\n享受 墮落 不斷地墜落 \n時間靜⽌止 懸空 屬於我編織的夢\n\n沒有始與終只沈醉其中  \n慾望的牢籠\n忘了上鎖', 288, '', '', '', '', 'StreetVoice 街聲', 'TWS651434002', 1, 1, 0, '2014-09-29 17:44:37', '2015-03-12 14:09:52', '0000-00-00 00:00:00'),
(80658, 307136, 7287, 3, 'Galatea''s Desire', '', '2014-09-21 00:00:00', 2000, 19, 0, 7, '', 'Galatea’s Desire/ Yu-Shin, WEN.\n\n溫柔的指尖\n輕撫冰冷的臉\n他為我刻上雙眼的綾線\n唇與唇之間\n像含花似欲言\n為何無法自拔 陶醉\n\n月輪迴 可否會實現\n夢太美 虛假的慰藉\n聽不見 沈默的誓言\n渴望能成真 會不會\n\n我有著女人多疑善妒的靈魂\n當他離開還是會冷\n只靜靜的等\n怎麼能奢望他別踏出那扇門\n只看著我一個人\n\nI wonder tonight\nThere’s nothing you would mind\nBeside my knees and sleep\nDream about me\nSinging lullaby but I know that’s a lie\nI dare I can touch him\nMany time I pray\n\n偷偷許了願\n離現實太遠\n與神的契約\n掉入人間樂園', 248, '', '', '', '', 'StreetVoice 街聲', 'TWS651434003', 1, 1, 0, '2014-09-29 17:45:49', '2015-03-12 14:09:52', '0000-00-00 00:00:00'),
(80659, 307136, 7287, 4, 'The Lamplighter', '', '2014-09-21 00:00:00', 2000, 19, 0, 7, '', 'The Lamplighter/ Yu-Shin, WEN.\n\n空氣裡熟悉的味道\n城市角落慢慢填滿些許人潮\n披上薄紗黃昏天空顏色有一點微妙\n抬起頭 感受那孤獨喧囂\n\n街道循序點綴微光\n一盞盞 點燈人身後升起了菱形月亮\n他掀起玻璃罩裡添上燭光的魔法杖\n好像童話故事 迷幻 閃爍 我不斷回想\n\n塵埃 飛散著 \n夜來 悲傷都睡著了\n等待 微風輕拂吹走了我的煩躁\n明白 你已不在\n\n凌晨兩點看著天花板發呆\n時鐘滴答運轉\n黑暗漩渦在腦海\n填滿盤桓思緒 比理還混亂\n人有一種壞習慣\n放開卻還留戀 悔憾 我好像個笨蛋\n一個人不習慣\n\n凌晨兩點看著天花板\n發呆聽時鐘滴答運轉\n黑暗漩渦在腦海\n不停的倒帶\n點燈人的故事裡片段\n靜靜的走在無人鋪石路之間\n\n徘徊 錯覺 還失眠\n不了解 不停歇 怎麼辦\n指路燈流沙般湛黃光芒在銀河系交界擱淺\n朦朧中半醒苦悶記憶再沈澱\n會不會 又是一齣鬧劇重複上演\n', 273, '', '', '', '', 'StreetVoice 街聲', 'TWS651434004', 1, 1, 0, '2014-09-29 17:47:15', '2015-03-12 14:09:52', '0000-00-00 00:00:00'),
