(80667, 307452, 7004, 8, '荒漠酒歌', '很久沒有喝得很茫了，也很久沒有沉溺在一個人來回踱步的午夜街道，只是我還記得午夜快要到來時，盛裝的人們聚集外舍旁的小七，蓄勢待發......而恐怕更多的是滷味攤旁邊的小巷裡，失落的人們。好懷念你們，你們都到哪裡去了？', '2014-04-01 00:00:00', 2000, 8, 0, 7, '掩面就走 潰堤淚流\n所有傷心往事又湧上心頭\n\n一手啤酒 河堤燈火\n失去靈魂的人們在此相擁\n\n眼見破碎青春青澀時光 一刻一刻流走\n想努力挽回一切 誰又鬆手\n連續encore兩次的表演 也有落幕的時候\n你卻仍執著等待後搖少年 不經意晃過\n\n按鈴下車 廢墟裡面\n漫長黑夜坐在街貓出沒的階\n我也吐了 你酒醒了\n馬車與玻璃鞋這時都要幻滅', '', 120, '', '', '', '', '亂彈阿哲', '', 0, 1, 0, '2014-09-29 22:26:12', '2015-03-12 14:09:52', '0000-00-00 00:00:00'),
