(80669, 111911, 0, 1, '聰明底猴子 demo', '', '2013-01-01 00:00:00', 2000, 69, 0, 7, '', 'If you don''t speak, then we don''t hear\nWhats the worth of all sayings? \nBecause we don''t see the needs to be unhappy\n\nwhile this world needs answers\noh, that''s in-different to me\nI will say just what you please\nI will learn what''s in your dreams\n\nabout this girl who cheated him\nhow she was everything\nhow this girl who kisses me\nbut now, all of a sudden, she disappears', 121, '', '', '', '', 'giselemine', '', 0, 1, 0, '2014-09-30 13:26:01', '2015-03-12 14:09:52', '0000-00-00 00:00:00'),
