(80671, 95349, 7290, 2, '黑羽', '', '2014-06-27 00:00:00', 2000, 20, 0, 9, '失序 惡夢般穿越 赤紅血腥的獸\n倒轉時序 堆砌純白流逝 凝視如冰霜靜止\n恐懼 疾如電掣風馳 覆蓋逃向未知\n瀕死之前 緊握最終的手 妖異混濁的夢\n\n翻越 墜落\n\n冷漠的視線 匯聚 綑綁著肉身\n無聲哭號 潰堤的鴉 盤旋絕望之城\n屍體等待重生 燒灼的傷痕 徒留了怨恨\n昇華的靈魂 振趐飛翔 飛往日出之向\n\n惡耗 夜火照耀 燃燒\n時間沙漏流逝 深陷泥沼\n\n過往一幕幕咧搬 血跡煞袂焦 纓纏袂煞\n離別的批是為誰 一字字咧寫 寫完告別再行\n(擁抱孤獨拋棄所有令自我更堅強\n如同睜開雙眼的第一刻便遠離了夢想\n\n愛人啊，敵人啊\n\n在流逝的最後，都一起凋零吧)\n傾頹的世界 橫流苦通夢迴\n恨曲不成調 餘音繚繞\n詩詞狂舞 編織 夜幕籠罩\n黎明將至 崩毀 等待破曉\n\n墜落的星辰 孤魂 閃耀殆盡至餘生\n悲願的傾訴 泣血迴盪至永恆 消散歸塵\n\n視線穿透於指間 窺見皆幻境\n真實交織殘酷 無聲的嚎出悲鳴\n蜷縮於純白 逃回最初的寧靜\n欲振乏力 半張的黑色羽翼', '', 308, '', '', '', '', '有料音樂', '', 1, 1, 0, '2014-09-30 13:54:03', '2015-03-12 14:09:52', '0000-00-00 00:00:00'),
(80672, 95349, 7290, 3, '夏夜飛霜', '', '2014-06-27 00:00:00', 2000, 20, 0, 9, '迷離 隔世久夢 徘徊清寂夜空\n初醒的翻湧 蜷縮 微弱脈搏\n未曾睜開雙眼 卻又陷入無盡長眠\n斬斷聯繫的枷鎖 孤星隕滅\n\n慚悚 不由無助顫抖 刺骨錐心的痛\n蹣跚步伐走向脆弱 蕭瑟冷風\n無情離拆 沒入幽暗死寂 陰冷陪伴\n已逝去生命的輪轉 墮業償還\n\n尚未開始 命運已走向終結 血腥的罪孽\n懵懂無知的過錯 不能逆轉 撕裂糾結\n夜夜啼哭 夢中的呼喚 陌生面容夜夜浮現\n無緣熟悉的臉 獨自懺悔 悲慟不絕\n\n幾近乾涸的眼淚滲血 髮絲斷落蒼白\n止不住的思念 愧歉 百轉千迴\n夜雨的騷動隨狂風 湧向四面\n吹不盡怨懟 凌亂 化不去殘缺\n\n刺目的光一點一點 未出世卻墜落死關\n神智亦是混亂 大開殺戒\n內心殘存依戀 無生不得輪轉\n渡不過三途川 徘徊世間 報怨\n\n沐血的身軀 無情的放捒\n褫不開的目睭 亦知冷暖\n\n纓纏心內的恨火 結作紅花\n夏夜降飛霜 片片若血\n此生注定渺茫 就此永別', '', 325, '', '', '', '', '有料音樂', '', 1, 1, 0, '2014-09-30 13:55:07', '2015-03-12 14:09:52', '0000-00-00 00:00:00'),
(80673, 95349, 7290, 4, '殘暮破曉', '', '2014-06-27 00:00:00', 2000, 20, 0, 9, '躁動 衝擊最深處的思緒 喚醒\n記憶 破碎翻騰浮現 再見過往綺麗光景\n\n被抹滅的曾經 隨時間消逝 被選擇的安逸\n是罪惡 無法逃脫的陷阱 無力掙扎 又為何陷溺\n\n不願聆聽如何找尋自己？\n\n怒氣 隨血液流竄環繞彌漫 破體\n恨意 眾志成城堆疊凝聚 高聳入雲\n\n跟隨憤怒的聲音 集結前行\n高舉緊握拳頭的雙臂 奮起\n步伐齊振動 極力呼喊的戰曲\n\n緊閉雙眼如何追求真理？\n樂音盼祭我輩先驅 在天之靈 願爾安息\n\n環繞 黑暗風雨籠罩 遙遠路途\n行走於死亡幽谷 深淵萬丈深處\n思緒凍結 猶如停滯的死水\n陷於被操控的世界 不辨是非\n\n無意識掌中跳舞的傀儡 不停旋轉\n拳養於狂風中的花蕊 難赦的罪\n\n肉身不曾脫離 抵抗達背意志的暴行\n靈魂從未禁錮 從此不再孤獨的身影\n非到絕境 無法體會生命的意義\n自由無人能囚禁 永不放棄真理的追尋\n\n烈火然燒 照映孤島\n用鮮血證明 用生命殉道\n\n苦難千回 終有時盡\n直至天幕漸明 微光透出\n\n不再沉睡 看見日曙', '', 298, '', '', '', '', '有料音樂', '', 1, 1, 0, '2014-09-30 13:56:06', '2015-03-12 14:09:52', '0000-00-00 00:00:00'),
(80674, 95349, 7290, 5, '惡終之葬', '', '2014-06-27 00:00:00', 2000, 20, 0, 9, '注視 不再熟悉的面容\n鏡中身影 灰暗目瞳\n面目蒼老如枯槁 生命步向寒冬\n\n如柴的手 顫抖 無力掌握\n恐懼來臨 苦痛的逼迫\n難以抵擋時間洪流 消逝\n無法逃脫的脆弱 深陷其中\n\n緩慢降臨 難以呼吸 痛苦陷入窒息\n冰冷枷鎖如荊棘 囚禁乾枯的身軀\n隨之破滅的曾經 殘缺的記憶\n夜色無垠 逼近 近在咫尺的幽冥\n\n死亡招手 不安的躁動\n無法倒流 回不到清醒的驚悚\n反覆掙脫 最終的最終\n無法倒流 噩夢中的噩夢\n\n後悔的時陣 生命漸黃昏\n無力跳動的心臟 眼神內已逝去光芒\n心中的怨恨 得不到允准\n絕氣 遇往之時 無人悼念的祭文\n\n無盡的悲傷 隨塵土落葬\n\n步向了河川 落雪初春 寒冷猶原\n等待 花開之時 歸途死亡再不返', '', 306, '', '', '', '', '有料音樂', '', 1, 1, 0, '2014-09-30 13:58:11', '2015-03-12 14:09:52', '0000-00-00 00:00:00'),
(80675, 95349, 7290, 6, '鴉夢', '', '2014-06-27 00:00:00', 2000, 20, 0, 9, '荒蕪敝 敗草燃 硝煙四竄\n風雲飛捲黑氣漫天\n末世衰 戰野殘\n絕祭命哭悲輓\n\n囂動 驚恐 數以千萬眾\n詭狩 暴行貪婪如獸\n啃蝕 遲隱速緩 肆無忌憚\n斷翅 無感痛楚已沒入吞食\n\n高聳惡業 堆砌如山 直貫\n斷魂塚 悲嚎迴盪 道氣短\n齊入幻 夢魘返\n再葬 陷溺無盡黑暗\n\n亡命喚 聲聲叫喚 黑羽何處飛來\n殊途 孤身影隻 回首低吟 淒冷雨水飛紛亂\n闢陰途 勾魂路 去將死引 渺渺茫茫哀戚\n駐足照看 翩翩舞夢境 護送來時路行\n\n強提首銜取魂魄 隨樂音迴盪將返\n夜鴉啼 空盤旋 翅展風飛傾斜 流竄\n渡岸回居 景緻如舊故土卻異換\n再見覆轍 恨嘆 頹落侵蝕苦痛換夢綻\n\n (ChthoniC - Freddy)千年光影 日頭赤焱\n(ChthoniC - Freddy)烏焦雙翼 孤飛的運命\n\n風雲飛捲 黑氣漫天\n\n(ChthoniC - Freddy)千年光影 獨身長夜\n(ChthoniC - Freddy)雪白火熏 風霜透骨的罪名\n\n景緻如舊故土卻異換\n頹落侵蝕苦痛換夢綻\n\n千年光影 日頭赤焱\n烏焦雙翼 孤飛的運命\n\n\n(ChthoniC - Freddy)千年光影 獨身長夜\n(ChthoniC - Freddy)雪白火熏 透心血的罪名 綑綁\n\n(ChthoniC - Freddy)軀體 (Anthelion - Code)如萬孔千穿 (ChthoniC - Freddy)意志 (Anthelion - Code)隨枯枝腐爛\n(ChthoniC - Freddy)魂魄 (Anthelion - Code)卻受困迷亂 白日沒於幽暗\n(ChthoniC - Freddy)光影 (Anthelion - Code)隨暗潮流轉 (ChthoniC - Freddy)命運定 (Anthelion - Code)孤怨長恨嘆\n(ChthoniC - Freddy)羽翼 (Anthelion - Code)逐塵世翻騰 光藏華斂動翅展\n\n慘白的面容 刻劃著悲傷\n何時盡 恨未離\n沐血再臨 烏羽再起', '', 360, '', '', '', '', '有料音樂', '', 1, 1, 0, '2014-09-30 14:10:47', '2015-03-12 14:09:52', '0000-00-00 00:00:00'),
(80676, 95349, 7290, 7, '月殞', '', '2014-06-27 00:00:00', 2000, 20, 0, 9, '', '', 317, '', '', '', '', '有料音樂', '', 1, 1, 0, '2014-09-30 14:23:05', '2015-03-12 14:09:53', '0000-00-00 00:00:00'),
(80677, 314481, 7291, 1, '漩渦', '', '2014-09-29 00:00:00', 2000, 25, 0, 4, '漩渦                曲：POLO  詞：POLO、田芯\n\n時鐘在等待 滴答滴答轉回來\n我們嘗試	在孤獨世界尋找愛的對白\n停 停不下來 像過去交會推開\n守住愉快 繼續依賴 \n\nCan''t I get a little break\n旋轉了 飄落眼淚\n順著回憶慢慢 挑動我們 愛情\nTill the end...\n\nDon''t you know that I''ll always be there...\nDon''t you know that I''ll always be here... \nDon''t you know that I''ll always be there...\nDon''t you know that I''ll always be here... \n\n\n畫面的空白	越靠近越快分開\n終於明白	原來彼此最後會重疊安排\n轉 轉不出來 像時針重複徘徊\n我們倒帶 繼續戀愛\n\nCan''t I get a little break\n旋轉了 飄落眼淚\n順著回憶慢慢 挑動我們 愛情\nTill the end...\n\nDon''t you know that I''ll always be there...\nDon''t you know that I''ll always be here... \nDon''t you know that I''ll always be there...\nDon''t you know that I''ll always be here... \n', '', 210, '', '', '', '', 'SeedMusic 種子音樂', '', 1, 1, 0, '2014-09-30 14:33:51', '2015-03-12 14:09:53', '0000-00-00 00:00:00'),
(80678, 95349, 7290, 8, '無赦', '', '2014-06-27 00:00:00', 2000, 20, 0, 9, '虛假 偽善的臉 令人作噁的作為\n口蜜腹劍 包裝著表面的反面\n愚昧 無知賤民 宣揚著流言蜚語\n空洞的眼 僅存空洞的視線\n\n罪惡積累 愚蠢無法改變\n不如撕裂 搬弄是非的嘴\n卑劣的極限 無法理解謙卑\n早日滅絕 化作永恆的夢魘\n\n竊用前半歲月自私 犯罪\n耗盡後半餘生懺悔告解\n如何說服自己\n標準不一 失衡的雙重界線\n\n陷入無盡輪迴 死結\n貪婪求存 醜陋的眷戀\n成就神的旨意 天國降臨\n戲謔手中卑賤 下地獄終結\n\n殺戮 鮮紅溫度 半殘氣味\n宛若鋼鐵 血腥的焠鍊\n訕笑 揚起妖異的旋律\n邪惡的曲 齊奏 眾生滅絕', '', 280, '', '', '', '', '有料音樂', '', 1, 1, 0, '2014-09-30 14:38:06', '2015-03-12 14:09:53', '0000-00-00 00:00:00'),
(80679, 95349, 7290, 9, '寂謠', '', '2014-06-27 00:00:00', 2000, 20, 0, 9, '劃破 虛為武裝 再見脆弱的臉孔\n慘白的笑容 堆砌虛無防備 滲血的夢\n\n眩目欲滴的紅 深陷於牢籠\n\n逃脫 真實腐朽 沉溺夜幕迷醉其中\n哭泣無法洗淨 是非罪惡\n扭曲自我 慾望橫流 現實與夢境的交錯\n\n謊言編織的世界 無法相信卻又無力改變\n相反的視線 注視天平兩端 失衡於永恆夢魘\n\n骯髒的過去 試圖埋葬的曾經\n\n閉鎖 絕緣於軀殼 囚牢破碎的心 盼求\n倒數末日的來臨 才終將毀滅 可否以救贖 消逝殆盡\n\n將一切歸零 回到空白的勇氣\n綻放無邊無際 最初的自己 將一切歸零\n\n噩夢 虛假 寂寞恐懼 逃離\n寄宿 惶恐 擊碎顫動 的痛\n\n\n迎向未知飛翔 張開雙翼\n奮力振翅 揮別蛻繭的過去\n貪婪的呼吸 需要氧氣\n掙脫束縛 飛向無邊天際\n\n是誰吟唱 遠方傳來的曲\n仔細聆聽 那是呼喚靈魂的聲音\n劃破虛偽武裝 褪去外衣\n毫無保留 沒有掩飾的自己', '', 321, '', '', '', '', '有料音樂', '', 1, 1, 0, '2014-09-30 14:45:16', '2015-03-12 14:09:53', '0000-00-00 00:00:00'),
