(80682, 115360, 0, 1, '無聲情歌(Demo)', '', '2014-09-30 00:00:00', 2000, 19, 1, 1, '想起九月那個時陣 天氣剛好正在燒熱\n那是一個充滿期待的生活\n有新的開始 新的環境 有新妹仔倘好看\n一想到 我就 未睏未呷\n\n你就坐在那個偏僻位置惦惦攏沒出聲\n阮的目珠內只有妳的形影\n想要跟妳講話 跟妳熟識 問妳叫什麼名\n順便邀妳 來去 看電影\n\n哪知站在妳的面前 阮卻變得這麼軟弱\n連喘氣都不敢出聲\n甘講妳攏不知 阮的心晟\n猶原轉頭坐上別人的車 作妳行\n\n最後的這首情歌 阮還不敢唱出聲\n不敢將阮心聲唱乎妳聽\n惦惦陪伴在妳身邊 做妳永遠的靠岸\n不管快樂也是悲傷 阮攏會在這\n\n最後的這首情歌 阮還不敢唱出聲\n不敢將阮心聲唱乎妳聽\n只要看到妳的笑容 加上妳的形影\n這首歌 代表阮的心聲', '', 257, '', '吳英弘', '吳英弘', '', 'DTRT做對樂團', '', 0, 1, 0, '2014-09-30 21:33:36', '2015-03-12 14:09:53', '0000-00-00 00:00:00'),
