(80688, 58093, 7292, 1, '愛情末班車(致敬勝文LIVE版)', 'MP3免費下載： http://taipeicases.blogspot.tw/p/mp3.html', '2014-10-01 00:00:00', 2014, 19, 2, 1, '愛情末班車(詞/曲：Funck)\n\n約會找個賣不掉的房間開 仲介先生讓我們進去做愛\n做完趕搭地鐵的最後一班 得去遠方再也不可能回來\n\n這裡格局很好 價格異想天開\n遠方有幾坪地讓我們待\n套子記得要戴 那裡不能承擔 我們的小孩\n\n約會找個拆不掉的房間開 警察先生讓我們進去做愛\n做完趕搭地鐵的最後一班 得去遠方再也不可能回來\n\n這裡格局很好 價格異想天開\n遠方有幾坪地讓我們待\n套子記得要戴 那裡不能承擔 我們的小孩\n\n這裡格局很好 價格異想天開\n遠方有幾坪地讓我們待\n套子一定要戴 那裡不能承擔 小孩沒得玩\n\n這裡格局很好 價格異想天開\n遠方有幾坪地讓我們待\n套子記得要戴 那裡不能承擔 我們的小孩\n\n這裡格局很好 價格異想天開\n遠方有幾坪地讓我們待\n套子一定要戴 那裡不能承擔 小孩沒得玩\n\n這裡格局很好 價格異想天開\n遠方有幾坪地讓我們待\n地鐵長路漫漫 車上有人做愛\n請你原諒他 請你原諒她', '', 278, '', 'Funck', 'Funck', '台北公案', '台北公案', '', 1, 1, 0, '2014-10-01 07:22:12', '2015-03-12 14:09:53', '0000-00-00 00:00:00'),
(80689, 306915, 0, 1, 'Tear Gas', '媒體操控著我們的雙眼\n試圖蒙蔽了我們的耳朵\n而埋藏在這底下的\n還有什麼是我們不知道的\n我們並不能改變歷史\n但是可以創造歷史\n儘管是用最激烈的手段\n也要抗爭到底', '2014-10-01 00:00:00', 2000, 19, 2, 7, '情境裡奮力抵抗，光著腳逃亡\n擊退了追逐者 也劃破自己手掌\n下一次出現距離這次並不長\n在我眼前，又重來一遍\n\n醜陋的一面在這裡稀鬆平常\n連自己也無法相像\n真實與假\n在分不清這兩者時 人格變化\n揮之不去的啊\n', '', 225, '', '逆關節擁抱 Reverse Hug', '小綠', '逆關節擁抱 Reverse Hug', 'RH', '', 0, 1, 0, '2014-10-01 14:46:41', '2015-03-12 14:09:53', '0000-00-00 00:00:00'),
